У КрНУ відкрили пункт волонтерської допомоги теробороні Кременчука. Приєднуйтесь!
Науково-педагогічні працівники Кременчуцького національного університету ім. М. Остроградського  організували пункт волонтерської допомоги.  Першочергова мета – збір продуктів та необхідних речей для потреб кременчуцької територіальної оборони. Закликаємо усіх небайдужих кременчужан долучатися до спільної волонтерської роботи!
 Пункт працює за адресою: вул. Першотравнева, 20, аудиторія 2104 (другий корпус університету, перший поверх, зліва від центрального входу). 
Графік роботи пункту: 9.00 – 16.00, сім днів на тиждень.
Телефони контактних осіб: Анфіса Шмельова – (097) 828-15-16;
Лариса Герасименко – (067) 900-43-65.
 Наразі у першочергових планах волонтерів – збір продуктових наборів (сухих пайків) для бійців тероборони. Також будуть відпрацьовуватися й інші напрями.
 Станом на 28 лютого, у підрозділів кременчуцької територіальної оборони існує потреба у таких продуктах та речах:
вода питна;
пакети середні/великі для фасування сухих пайків;
їжа тривалого зберігання (ковбаси, тушонка, консерви, печиво/галети фасовані, згущене молоко у пакетах, солодощі, кава, чай тощо);
Також потрібні:
бронежилети;
протигази;
ізолон 300-500 рулонами (для карематів);
рації BAOFENG DM (у пріоритеті) або інші моделі цієї марки.

